import React from "react";
//Hook

const FreeBoardLists = ({ posts, loading }) => {
  //console.log(posts);

  return (
    <>
      {loading && <div> loading... </div>}
      <div className="max-w-480 ">
        {posts.map((post) => (
          <div className="h-28 p-4 border-b" key={post.id}>
            <h2 className="text-base">{post.title}</h2>
            <p className="text-sm text-gray-400 overflow-hidden leading-4 linemax-h-12">
              {post.body}
            </p>
          </div>
        ))}
      </div>
    </>
  );
};

export default FreeBoardLists;
